import React from 'react'
import { Input } from 'reactstrap'

const Checkbox = ({ name, id, value, checked, labelName }) => {
  return (
    <div>
      <Input
        type="checkbox"
        name={name}
        checked={checked}
        id={id}
        value={value}
      />
      {labelName ? <label for={id}>{labelName}</label> : null}
    </div>
  )
}

export default Checkbox
